import React from 'react';
import { BrowserRouter as Router, Switch, Route, Redirect } from 'react-router-dom';
import NotFoundPage from 'components/common/NotFoundPage';
import FlightListContainer from 'components/airports/list/FlightListContainer';
import CountryListContainer from 'components/countries/list/CountryListContainer';
import AirlineListContainer from 'components/airlines/list/AirlineListContainer';

const router = (
  <Router>
    <Switch>
      <Route exact path="/">
        <Redirect to="/airports" />
      </Route>
      <Route exact path="/airports" component={FlightListContainer} />
      <Route exact path="/countries" component={CountryListContainer} />
      <Route exact path="/airlines" component={AirlineListContainer} />
      <Route component={NotFoundPage} />
    </Switch>
  </Router>
);

export default router;
